import React from "react";

function Card(props) {
    function handleClick() {
        props.onCardClick(props.card);
      }  
    return(
        <div className="element">
            <button className="element__img-popup" onClick={handleClick()}>
                <img className="element__img" alt={props.alt} src={props.src}/>
            </button>
            <button type="button" className="element__delete" id="deletButton"></button>
            <div className="element__name">
                <h2 className="element__paragraph">{props.title}</h2>
                <div className="element__like-zone">
                    <button type="button" className="element__like"></button>
                    <span className="element__counter">{props.likes}</span>
                </div>
            </div>
        </div>
    )
}
export default Card
